import React from "react";

import Auxiliary from "./../../../../../hoc/Auxiliary";
import TachaGrandeSeparada from "./ModelosFormaRectangular/Tachas/TachaGrandeSeparada";
import TachaJuntaPerimetral from "./ModelosFormaRectangular/Tachas/TachaJuntaPerimetral";
import DobleTacha from "./ModelosFormaRectangular/Tachas/DobleTacha";
import SuperDobleTacha from "./ModelosFormaRectangular/Tachas/SuperDobleTacha";
import TachaJuntaInterna from "./ModelosFormaRectangular/Tachas/TachaJuntaInterna";
import Botone from "./ModelosFormaRectangular/Botone/Botone";
import Capitone from "./ModelosFormaRectangular/Capitone/Capitone";
import CapitoneDobleTacha from "./ModelosFormaRectangular/Capitone/CapitoneDobleTacha";
import CanelonGordo from "./ModelosFormaRectangular/Canelon/CanelonGordo";
import CanelonAngosto from "./ModelosFormaRectangular/Canelon/CanelonAngosto";
import CanelonHorizontal from "./ModelosFormaRectangular/Canelon/CanelonHorizontal";
import ConFunda from "./ModelosFormaRectangular/Otros/ConFunda";
import ConMarcoParaiso from "./ModelosFormaRectangular/Otros/ConMarcoParaiso";

function DibujoModelos(props) {
  let modelo = null;
  if (props.forma === "Rectangular") {
    switch (props.modelo) {
      case "Tacha Grande Separada":
        modelo = <TachaGrandeSeparada />;
        break;
      case "Tacha Junta Perimetral":
        modelo = <TachaJuntaPerimetral />;
        break;
      case "Doble Tacha":
        modelo = <DobleTacha />;
        break;
      case "Super Doble Tacha Junta":
        modelo = <SuperDobleTacha />;
        break;
      case "Tacha Junta Interna":
        modelo = <TachaJuntaInterna />;
        break;
      case "Botoné":
        modelo = <Botone />;
        break;
      case "Capitone":
        modelo = <Capitone />;
        break;
      case "Capitone y Doble Tacha":
        modelo = <CapitoneDobleTacha />;
        break;
      case "Canelon Gordo":
        modelo = <CanelonGordo />;
        break;
      case "Canelon Angosto":
        modelo = <CanelonAngosto />;
        break;
      case "Canelon Horizontal":
        modelo = <CanelonHorizontal />;
        break;
      case "Con Funda":
        modelo = <ConFunda />;
        break;
      case "Con Marco en Paraiso Macizo":
        modelo = <ConMarcoParaiso />;
        break;
      default:
        modelo = null;
        break;
    }
  }

  return <Auxiliary>{modelo}</Auxiliary>;
}

export default DibujoModelos;
